

-- drop table zz_encounters_to_delete
-- 7,052 encounter skipped
-- 8,665 encounter to delete
select encounterID
into zz_encounters_to_delete
from encounter e
where dateOfService < '3/1/2010'
	and e.practiceID=2
	and encounterId not in (	
				
				select encounterId
				from encounterProcedure ep
					inner join claim c
						on c.encounterProcedureId=ep.encounterProcedureId
				where 
					(exists(select * from paymentClaim pc where pc.claimId=c.claimID)
						OR exists(select * from dbo.ClaimAccounting_Billings cb where cb.claimID=c.claimID)
					)
		)
order by encounterId

		

